import React from 'react';
import styled from 'styled-components';

const Roadtask = styled('div')`
  display: flex;
  margin:auto;
  background-color: #E8E5E5;
  max-width: 100%;
  width:20%;
  color: blue;
  padding: 32px;
`;

export default Roadtask;
